fn number(n: usize) -> String {
    /// 0
    const ZERO: &str = "+[]";
    /// 1
    const ONE: &str = "+!![]";
    if n == 0 {
        ZERO.to_string()
    } else if n == 1 {
        ONE.to_string()
    } else {
        (0..n).map(|_| "!![]").collect::<Vec<_>>().join("+")
    }
}

fn boolean(b: bool) -> &'static str {
    /// true
    const TRUE: &'static str = "!![]";
    /// false
    const FALSE: &'static str = "![]";
    if b {
        TRUE
    } else {
        FALSE
    }
}

/// # Example
/// * 1 -> "1"
/// * true -> "true"
fn to_string(javascript: &str) -> String {
    format!("([]+[])+{javascript}")
}

